import React, { useState }  from "react";
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import InputGroup from 'react-bootstrap/InputGroup';
import "./bootstrap.min.css"
import Modal from 'react-bootstrap/Modal';
import TextField from '@material-ui/core/TextField';

export default function Header() {

  const [show, setShow] = useState(false);

  return(
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="#home">La Cattanea</Navbar.Brand>
        <Navbar.Toggle />
        <Navbar.Collapse>
          <Nav>
            <Nav.Link href="#menu">Men√π</Nav.Link>
            <Nav.Link href="#carrello">Carrello</Nav.Link>
          </Nav>
        </Navbar.Collapse>
        <Navbar.Collapse class="justify-content-end">
          <Nav>
            <Nav.Link onClick={() => setShow(true)}>Login</Nav.Link>
            <Modal
              show={show}
              onHide={() => setShow(false)}
              dialogClassName="modal-90w"
              aria-labelledby="example-custom-modal-styling-title"
            >
              <Modal.Header closeButton>
                <Modal.Title id="example-custom-modal-styling-title">
                  Login
                </Modal.Title>
              </Modal.Header>
              <Modal.Body>
                <InputGroup className="mb-3">
                  <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                  <TextField id="outlined-1" label="Outlined" variant="outlined" />
                </InputGroup>
              </Modal.Body>
            </Modal>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );

}
